import React from "react";
import {Routes, Route, Link} from "react-router-dom"

import Home from "./pages/home";

function App() {
  return (
    <div className="App">
      <nav>
      <Link to="/">Home</Link>
      </nav>

      <nav>
        <Link to="/login">Login</Link> | <Link to="/register">Register</Link>
      </nav>

  <Routes>
     <Route path="/" element={<Home />} />
  </Routes>
    </div>
  );
}

export default App;
